import React from "react";
import { BrowserRouter as router, Route } from 'react-router-dom';
import { Navbar, Button, Card, CardImg } from "reactstrap";

const App = () => {
  return (
    <Route>
      <Navbar color='info'>
        <h1 style={{ color: 'white' }}>WeEat</h1>
        <Button color='info'>
          Home
      </Button>
      </Navbar>
      <Card>
        <Button color='info' style={{ position: 'absolute', top: '50%', left: '50%' }}>
          Tacos!
        </Button>
        <CardImg src={require('./assets/taco.jpeg')} />
      </Card>
    </Route>


  );
};
export default App;
